<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Document</title>
</head>
<body>
    <p id="demo"></p>
    <script>
        var names = new Set (["RAKESH", "RAJ","SARA","RAKESH","RAHUL"])
        names.add("ramesh");
       let txt = "";
       for (const name of names.values()){
        txt += name + "<br>";
       }
         document.getElementById("demo").innerHTML =txt;
    </script>
    
</body>
</html>
